import { Injectable } from '@angular/core';
import { ComplicationOsteoporose } from '../models/ComplicationOsteoporose';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class OsService {

  private apiUrl = 'https://localhost:7129/api/ComplicationOsteoporoses';

  constructor(private http: HttpClient) { }
  addos(ComplicationOsteoporose: ComplicationOsteoporose): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationOsteoporose);

    return this.http.post<any>(`${this.apiUrl}/addos`, ComplicationOsteoporose, { observe: 'response' });
  }}
